import React from 'react';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';

const About = () => (
<div>
<h2>About</h2>
<p>This application provides information about the products.</p>
</div>
);
const Products = () => (
<div>
<h2>Product List</h2>
   {/* Include your previous table code here */}
</div>
);
const App = () => {
 return (
<Router>
<div>
<h1>Product App</h1>
<nav>
<ul>
<li>
<Link to="/">About</Link>
</li>
<li>
<Link to="/products">Products</Link>
</li>
</ul>
</nav>
<Route path="/" exact component={About} />
<Route path="/products" component={Products} />
</div>
</Router>
 );
};
export default App;
